        <script>

/**
 * jQuery Plugin: Sticky Tabs
 *
 * @author Aidan Lister <aidan@php.net>
 * adapted by Ruben Arslan to activate parent tabs too
 * http://www.aidanlister.com/2014/03/persisting-the-tab-state-in-bootstrap/
 */
(function($) {
  "use strict";
  $.fn.rmarkdownStickyTabs = function() {
    var context = this;
    // Show the tab corresponding with the hash in the URL, or the first tab
    var showStuffFromHash = function() {
      var hash = window.location.hash;
      var selector = hash ? 'a[href="' + hash + '"]' : 'li.active > a';
      var $selector = $(selector, context);
      if($selector.data('toggle') === "tab") {
        $selector.tab('show');
        // walk up the ancestors of this element, show any hidden tabs
        $selector.parents('.section.tabset').each(function(i, elm) {
          var link = $('a[href="#' + $(elm).attr('id') + '"]');
          if(link.data('toggle') === "tab") {
            link.tab("show");
          }
        });
      }
    };


    // Set the correct tab when the page loads
    showStuffFromHash(context);

    // Set the correct tab when a user uses their back/forward button
    $(window).on('hashchange', function() {
      showStuffFromHash(context);
    });

    // Change the URL when tabs are clicked
    $('a', context).on('click', function(e) {
      history.pushState(null, null, this.href);
      showStuffFromHash(context);
    });

    return this;
  };
}(jQuery));

window.buildTabsets = function(tocID) {

  // build a tabset from a section div with the .tabset class
  function buildTabset(tabset) {

    // check for fade and pills options
    var fade = tabset.hasClass("tabset-fade");
    var pills = tabset.hasClass("tabset-pills");
    var navClass = pills ? "nav-pills" : "nav-tabs";

    // determine the heading level of the tabset and tabs
    var match = tabset.attr('class').match(/level(\d) /);
    if (match === null)
      return;
    var tabsetLevel = Number(match[1]);
    var tabLevel = tabsetLevel + 1;

    // find all subheadings immediately below
    var tabs = tabset.find("div.section.level" + tabLevel);
    if (!tabs.length)
      return;

    // create tablist and tab-content elements
    var tabList = $('<ul class="nav ' + navClass + '" role="tablist"></ul>');
    $(tabs[0]).before(tabList);
    var tabContent = $('<div class="tab-content"></div>');
    $(tabs[0]).before(tabContent);

    // build the tabset
    var activeTab = 0;
    tabs.each(function(i) {

      // get the tab div
      var tab = $(tabs[i]);

      // get the id then sanitize it for use with bootstrap tabs
      var id = tab.attr('id');

      // see if this is marked as the active tab
      if (tab.hasClass('active'))
        activeTab = i;

      // remove any table of contents entries associated with
      // this ID (since we'll be removing the heading element)
      $("div#" + tocID + " li a[href='#" + id + "']").parent().remove();

      // sanitize the id for use with bootstrap tabs
      id = id.replace(/[.\/?&!#<>]/g, '').replace(/\s/g, '_');
      tab.attr('id', id);

      // get the heading element within it, grab it's text, then remove it
      var heading = tab.find('h' + tabLevel + ':first');
      var headingText = heading.html();
      heading.remove();

      // build and append the tab list item
      var a = $('<a role="tab" data-toggle="tab">' + headingText + '</a>');
      a.attr('href', '#' + id);
      a.attr('aria-controls', id);
      var li = $('<li role="presentation"></li>');
      li.append(a);
      tabList.append(li);

      // set it's attributes
      tab.attr('role', 'tabpanel');
      tab.addClass('tab-pane');
      tab.addClass('tabbed-pane');
      if (fade)
        tab.addClass('fade');

      // move it into the tab content div
      tab.detach().appendTo(tabContent);
    });

    // set active tab
    $(tabList.children('li')[activeTab]).addClass('active');
    var active = $(tabContent.children('div.section')[activeTab]);
    active.addClass('active');
    if (fade)
      active.addClass('in');

    if (tabset.hasClass("tabset-sticky"))
      tabset.rmarkdownStickyTabs();
  }

  // convert section divs with the .tabset class to tabsets
  var tabsets = $("div.section.tabset");
  tabsets.each(function(i) {
    buildTabset($(tabsets[i]));
  });
};

        <style type="text/css">
body {
margin: 0;
color: var(--text-color);
background: var(--page-background);
}
html,
body {
text-rendering: optimizeLegibility;
-webkit-font-smoothing: antialiased;
font-size: 16px;
line-height: 1.7;
font-family: 'Raleway', sans-serif;
}
* {
box-sizing: border-box
}
.Content a,
.page-content a,
a {
color: var(--link-color);
text-decoration: none
}
.Content a:hover {
text-decoration: underline
}
.external-link-icon {
color: #aaa;
display: inline-block
}
.medium-zoom-image--opened,
.medium-zoom-overlay {
z-index: 99
}
.Wrap {
max-width: 1180px
}
.layout-wide .Wrap {
max-width: 100%
}
.layout-narrow .Wrap {
margin: 0 auto
}
.InjectedComponents[data-position="mobile-sidebar:start"],
.InjectedComponents[data-position="sidebar:start"] {
margin-bottom: 25px
}
.InjectedComponents[data-position="mobile-sidebar:start"]>:first-child,
.InjectedComponents[data-position="sidebar:start"]>:first-child {
margin-top: 0
}
.InjectedComponents[data-position="sidebar:end"],
.InjectedComponents[data-position="sidebar:post-end"] {
margin-top: 25px
}
.InjectedComponents[data-position="sidebar:end"]>:first-child,
.InjectedComponents[data-position="sidebar:post-end"]>:first-child {
margin-top: 0
}
.InjectedComponents[data-position="content:start"] {
margin-bottom: 35px
}
.InjectedComponents[data-position="content:start"]>:first-child {
margin-top: 0
}
.InjectedComponents[data-position="content:start"]>:last-child {
margin-bottom: 0
}
.InjectedComponents[data-position="content:end"] {
margin-top: 30px
}
.InjectedComponents[data-position="header-right:start"]+.header-nav {
margin-left: 30px
}
@media (min-width:1000px) {
.InjectedComponents[data-position="mobile-sidebar:end"],
.InjectedComponents[data-position="mobile-sidebar:start"] {
display: none
}
}
.external-link-icon {
margin-left: 3px
}
.header-nav {
display: flex;
align-items: center;
font-size: 1rem
}
@media (max-width:1000px) {
.header-nav {
display: none
}
}
a {
color: var(--nav-link-color)
}
.header-nav-item {
height: 100%
}
.header-nav-item:not(:first-child) {
margin-left: 25px
}
.header-nav-item>a {
display: inline-flex;
align-items: center;
line-height: 1.4;
height: 100%;
position: relative
}
.header-nav-item>a:after {
content: "";
height: 2px;
width: 100%;
position: absolute;
bottom: 0;
left: 0;
right: 0;
display: block
}
.header-nav-item>a.router-link-exact-active {
color: var(--accent-color)
}
.header-nav-item>a.router-link-exact-active:after {
background-color: var(--nav-link-border-color)
}
.mobile-header-nav {
display: block;
margin-bottom: 30px;
padding: 0 20px 30px;
border-bottom: 1px solid var(--border-color)
}
.mobile-header-nav .header-nav-item:not(:first-child) {
margin-left: 0
}
@media (min-width:1000px) {
.mobile-header-nav {
display: none
}
}
.SidebarItem:not(:last-child) {
margin-bottom: 10px
}
.SidebarItem {
font-size: .875rem
}
.SidebarItem a {
color: var(--sidebar-link-color)
}
.SidebarItem a:hover {
color: var(--sidebar-link-active-color)
}
.Sidebar {
width: var(--sidebar-width);
background: var(--sidebar-background);
position: fixed;
top: var(--header-height);
bottom: 0;
z-index: 9;
overflow-y: auto;
padding: 40px 0 30px;
word-break: break-word
}
.Sidebar a {
text-decoration: none;
color: var(--text-color)
}
@media (max-width:1000px) {
.Sidebar {
left: 0;
transform: translateX(-100%);
width: 80%;
transition: transform .5s cubic-bezier(.5, .32, .01, 1);
padding: 30px 0;
border-right: 1px solid var(--border-color)
}
.Sidebar.isShown {
transform: translateX(0)
}
}
@media print {
.Sidebar {
display: none
}
}
.SidebarMask {
position: fixed;
top: 0;
bottom: 0;
left: 0;
right: 0;
z-index: 8
}
.sidebar-toggle {
display: flex;
height: 100%;
align-items: center
}
@media (min-width:1000px) {
.sidebar-toggle {
display: none
}
}
@media print {
.sidebar-toggle {
display: none
}
}
.sidebar-toggle svg {
width: 20px;
height: 20px;
margin-right: 10px
}
.Header {
height: var(--header-height);
position: fixed;
top: 0;
left: 0;
right: 0;
z-index: 33;
border-bottom: 1px solid var(--border-color);
background: var(--header-background);
color: var(--header-text-color)
}
@media print {
.Header {
position: static
}
}
.Wrap {
height: 100%
}
.site-title {
font-weight: 400;
margin: 0 25px 0 0;
font-size: 1.2rem;
display: flex;
align-items: center;
white-space: nowrap
}
.site-title a {
color: inherit;
text-decoration: none
}
.header-inner {
height: 100%;
padding: 0 20px;
position: relative;
display: flex;
align-items: center
}
@media print {
.header-inner {
padding: 0
}
}
.header-left {
display: flex
}
.header-right {
display: flex;
position: absolute;
right: 20px;
top: 0;
height: 100%;
background: var(--header-background)
}
@media print {
.header-right {
display: flex;
right: 0;
padding-right: 0
}
.header-right .header-nav {
display: flex
}
}
.prev-next-links {
overflow: auto;
margin-top: 40px;
padding-top: 30px;
border-top: 1px solid var(--border-color)
}
@media print {
.prev-next-links {
display: none
}
}
.prev-link {
float: left
}
.next-link {
float: right
}
.EditLink {
margin-top: 50px
}
.EditLink a {
display: inline-flex;
align-items: center
}
.icon {
width: 18px;
height: 18px;
margin-right: 10px
}
.token.cdata,
.token.comment,
.token.prolog {
color: #637777;
font-style: italic
}
.token.punctuation {
color: #c792ea
}
.namespace {
color: #b2ccd6
}
.token.deleted {
color: rgba(239, 83, 80, .56);
font-style: italic
}
.token.property,
.token.symbol {
color: #80cbc4
}
.token.keyword,
.token.operator,
.token.tag {
color: #7fdbca
}
.token.boolean {
color: #ff5874
}
.token.number {
color: #f78c6c
}

        <script>
// Apply CSS variables defined in downcute_styles.js
function toggle_style(toggler, theme) {
    if (toggler.classList.contains("checked")) {
        set_dark_style(theme);
    } else {
        set_light_style(theme);
    }
}

window.addEventListener("load", (event) => {

    // Theme
    let theme = "default";
    const downcute_root = document.getElementById("docute");
    if (downcute_root !== null && downcute_root.classList.contains('theme-chaos')) {
        theme = "chaos";
    }

    // Dark mode 
    const toggler = document.querySelector(".dark-theme-toggler .toggle");
    toggle_style(toggler, theme);
    toggler.addEventListener("click", (event) => {
        toggler.classList.toggle("checked");
        toggle_style(toggler, theme);
    })

    // Make tables responsive
    $(".page-content table").wrap("<div class='table-wrapper'></div>");

    // Fix for dots in level 1 and level 2 titles
    $('body .section.level1').each(function () {
        $(this).attr("id", $(this).attr("id").replace(/\./g, "-"));
    });
    $('body .section.level2').each(function () {
        $(this).attr("id", $(this).attr("id").replace(/\./g, "-"));
    });
    $('#toc ul li a').each(function () {
        $(this).attr("href", $(this).attr("href").replace(/\./g, "-"));
    });

    // ScrollSpy also requires that we use a Bootstrap nav component.
    $('#toc ul').first().addClass('nav');
    $('body').scrollspy({ target: '#toc' });

    $("body").removeClass("preload");

    // Prism highlighting
    const prism_highlight = new Event('prism_highlight');
    document.addEventListener('prism_highlight', (e) => Prism.highlightAll())

    let code_el = document.querySelectorAll("pre[class] code");
    code_el.forEach(el => {
        const classes = el.parentNode.className.split(" ");
        classes.forEach(classe => {
            if (classe != 'sourceCode') {
                el.classList.add('language-' + classe);
            }
        })
    })
    document.dispatchEvent(prism_highlight);


})

</script>
